import phones from "../data/phone_list";
import lasPhones from "../data/las_phones";

const getDeviceData = () => {
  let i = 0;
  let searchDevice = [];

  console.log(phones['phones'])

  phones['phones'].forEach(phone => {
    const container = require(`../data/phones/${phone}.json`);
    const changeName = container => !container ? "" : container
    const changeUser = container => null ? "" : container

    if (changeUser(container.resources[0].data.lines.line[0].displayAscii) === null) {
      print("null")
    }

    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: changeName(container.resources[0].data.name.toUpperCase())
      },
      {
        key: i,
        type: "user",
        data: changeUser(container.resources[0].data.lines.line[0].displayAscii)
      },
      {
        key: i,
        type: "line",
        data: changeName(container.resources[0].data.lines.line[0].dirn.pattern)
      },
      {
        key: i,
        type: "mask",
        data: changeName(container.resources[0].data.lines.line[0].e164Mask)
      },
      {
        key: i,
        type: "ip",
        data: changeName(container.resources[0].data.ip_address)
      },
      {
        key: i,
        type: "location",
        data: container.resources[0].meta.hierarchy.split("_").pop().toLowerCase()
      }
    ]);
  });

  lasPhones['devices'].forEach(device => {
    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: device.mac
      },
      {
        key: i,
        type: "user",
        data: device.user
      },
      {
        key: i,
        type: "line",
        data: device.line
      },
      {
        key: i,
        type: "mask",
        data: ""
      },
      {
        key: i,
        type: "ip",
        data: ""
      },
      {
        key: i,
        type: "location",
        data: "LAS"
      }
    ]);
  });

  i++;
  searchDevice.forEach(e => {if (!e[1].data) e[1].data = ""})

  return searchDevice;
};

export default getDeviceData();
